function UlFlexImgText(props) {
    const css = {
        body : {
            width: '100%',
            height: 'auto',
            paddingTop: '10px',
            paddingBottom: '10px',
            backgroundColor: props.backgroundColor,
        },
        ul : {
            listStyleType: 'none',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
        },
        element : {
            width: '350px',
            height: '380px',
            color: 'white',
            backgroundColor: '#102038',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',

        }
    }
    const UlForm = (count) => {
        let h1Text = eval('props.h1Text' + count);
        let text = eval('props.text' + count);
        return (
            <div style={css.element}>
                <img src={props.img[count + 1]} alt=""/>
                <h1>{h1Text}</h1>
                <text>{text}</text>
            </div>
        )
    }
    const countCheck = (count) => {
        if (count === 4) {
            return (
                <ul style={css.ul}>
                    <li>{UlForm(1)}</li>
                    <li>{UlForm(2)}</li>
                    <li>{UlForm(3)}</li>
                    <li>{UlForm(4)}</li>
                </ul>
            )
        } else if (count === 5) {
            return (
                <ul style={css.ul}>
                    <li>{UlForm(1)}</li>
                    <li>{UlForm(2)}</li>
                    <li>{UlForm(3)}</li>
                    <li>{UlForm(4)}</li>
                    <li>{UlForm(5)}</li>
                </ul>
            )
        } else if (count === 6) {
            return (
                <ul style={css.ul}>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            )
        }
    }


    return (
        <div style={css.body}>
            {countCheck(props.count)}


        </div>
    )
}

export default UlFlexImgText;
